function minimumSeconds(nums: number[]): number {
    const n = nums.length;
    if (n <= 1) return 0;

    // Function to find greatest common divisor
    const gcd = (a: number, b: number): number => {
        while (b !== 0) {
            let t = b;
            b = a % b;
            a = t;
        }
        return a;
    };

    // Function to find the cycle length starting from index 0
    const findCycleLength = (start: number): number => {
        let current = nums[start], count = 1;
        let i = (start + 1) % n;
        while (i !== start && nums[i] !== current) {
            current = nums[i];
            i = (i + 1) % n;
            count++;
        }
        return count;
    };

    let cycleLength = findCycleLength(0);
    for (let i = 1; i < n; i++) {
        if (nums[i] !== nums[0]) {
            cycleLength = gcd(cycleLength, findCycleLength(i));
        }
    }

    return cycleLength === n ? 1 : 2;
}
